sympy.sympy.polys.agca.extensions.__sub_:
def __sub__(f, g):
    rep = f._get_rep(g)
    if rep is not None:
        return ExtElem(f.rep - rep, f.ext)
    else:
        return NotImplemented

sympy.sympy.polys.domains.expressiondoma:
def __sub__(f, g):
    g = f._to_ex(g)

    if g is None:
        return NotImplemented
    elif g == EX.zero:
        return f
    elif f == EX.zero:
        return -g
    else:
        return f.simplify(f.ex - g.ex)

sympy.sympy.polys.domains.modularinteger:
def __add__(self, other):
    val = self._get_val(other)

    if val is not None:
        return self.__class__(self.val + val)
    else:
        return NotImplemented

sympy.sympy.polys.polyclasses.__sub__:
def __sub__(f, g):
    if isinstance(g, ANP):
        return f.sub(g)
    try:
        g = f.dom.convert(g)
    except CoercionFailed:
        return NotImplemented
    else:
        return f.sub_ground(g)

sympy.sympy.polys.rings.__add__:
def __add__(
    self, other: PolyElement[Er] | Er | int | PolyElement[PolyElement[Er]], /
) -> PolyElement[Er] | PolyElement[PolyElement[Er]]:
    """Add two polynomials.

    Examples
    ========

    >>> from sympy.polys.domains import ZZ
    >>> from sympy.polys.rings import ring

    >>> _, x, y = ring('x, y', ZZ)
    >>> (x + y)**2 + (x - y)**2
    2*x**2 + 2*y**2

    """
    if self.ring.is_element(other):
        return self._add(other)

    if isinstance(other, PolyElement):
        domain = other.ring.domain
        if isinstance(domain, PolynomialRing) and domain.ring.is_element(self):
            return cast("PolyElement[PolyElement[Er]]", other)._add_ground(self)

    res = self._try_add_ground(other)
    if res is not NotImplemented:
        return res

    if isinstance(other, PolyElement):
        return other._try_add_ground(self)

    return NotImplemented

sympy.sympy.polys.rings.__sub__:
def __sub__(
    self, other: PolyElement[Er] | Er | int | PolyElement[PolyElement[Er]], /
) -> PolyElement[Er] | PolyElement[PolyElement[Er]]:
    """Subtract polynomial p2 from p1.

    Examples
    ========

    >>> from sympy.polys.domains import ZZ
    >>> from sympy.polys.rings import ring

    >>> _, x, y = ring('x, y', ZZ)
    >>> p1 = x + y**2
    >>> p2 = x*y + y**2
    >>> p1 - p2
    -x*y + x

    """
    if self.ring.is_element(other):
        return self._sub(other)

    if isinstance(other, PolyElement):
        domain = other.ring.domain
        if isinstance(domain, PolynomialRing) and domain.ring.is_element(self):
            return cast("PolyElement[PolyElement[Er]]", other)._sub_ground(self)

    res = self._try_sub_ground(other)
    if res is not NotImplemented:
        return res

    if isinstance(other, PolyElement):
        return other._try_rsub_ground(self)

    return NotImplemented
